import React from 'react';
import { Progress } from 'antd';
import '../../styles/Dashboard.css'; // Import your styles here

const Dashboard = () => {
  return (
    <div className="dashboard">
      <div className="energy-summary">
        <div className="energy-item">
          <Progress
            type="circle"
            percent={50}
            strokeColor="#5E5CE6"
            format={() => '938 Kcal'}
            width={120}
          />
          <p>Calorie consumed</p>
        </div>
        <div className="energy-item">
          <Progress
            type="circle"
            percent={50}
            strokeColor="#5E5CE6"
            format={() => '938 Kcal'}
            width={120}
          />
          <p>Calorie remaining</p>
        </div>
      </div>
      <div className="macro-targets">
        <div className="macro-item">
          <Progress
            type="circle"
            percent={75}
            strokeColor="#5E5CE6"
            format={() => '345/453 (g)'}
            width={100}
          />
          <p>Protein</p>
        </div>
        <div className="macro-item">
          <Progress
            type="circle"
            percent={75}
            strokeColor="#5E5CE6"
            format={() => '345/453 (g)'}
            width={100}
          />
          <p>Net Carb</p>
        </div>
        <div className="macro-item">
          <Progress
            type="circle"
            percent={75}
            strokeColor="#5E5CE6"
            format={() => '345/453 (g)'}
            width={100}
          />
          <p>Fat</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
